import React from 'react';

function Url () {
	
	const api = "https://urlscan.io/api/v1/search/?q=domain:urlscan.io";

	fetch( api )
	.then( url => url.json() )
	.then( url => {
		console.log( url );
	});

	return (
		<section className="url"></section>
	);
};

export default Url;
